import React, {Component} from 'react';
import PDF0 from './form/0.pdf'
import IMG0 from './image/form/0.png'
import PDF1 from './form/1.pdf'
import PDF2 from './form/2.pdf'
import PDF3 from './form/3.pdf'
import PDF4 from './form/4.pdf'
import PDF5 from './form/5.pdf'
import PDF6 from './form/6.pdf'
import PDF7 from './form/7.pdf'
import PDF8 from './form/8.pdf'
import PDF9 from './form/9.pdf'
import PDF10 from './form/10.pdf'


class Form extends Component{

  render(){
    const forms = [
      {
        'url' : PDF0,
        'title' : '14 Month Questionaire',
        'sample' : IMG0
      },
      {
        'url' : PDF1,
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      },
      {
        'url' : PDF2,
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      },
      {
        'url' : PDF3,
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      }
    ];
    const FormPDF = props =>{
      const forms = props.form.map((form,index) =>{
        return(
          <div key={index} className="col-md-3 text-center">
            <a href={form.url} className="col-md-12">
              <img className="col-md-12" src={form.sample} alt="Need Image of Form"/>
              <p className="col-md-12 justify-content-center">{`image at ${form.title}`}</p>
            </a>
          </div>
        )
      });
      return <section id="forms" className="row">
          <h1 className="col-md-12 text-center">Forms</h1>
          {forms}
        </section>
    };
    return <FormPDF id="form" form={forms} />;
  }
}
export default Form;
